CREATE TABLE public.geographic (
    city_name text,
    county text,
    region text
);

COMMENT ON COLUMN public.geographic.city_name IS 'The lowercased name of the city';

COMMENT ON COLUMN public.geographic.county IS 'The lowercased name of the county';

COMMENT ON COLUMN public.geographic.region IS 'The lowercased name of the region';

CREATE TABLE public.location (
    restaurant_id bigint,
    house_number bigint,
    street_name text,
    city_name text
);

COMMENT ON COLUMN public.location.restaurant_id IS 'Unique identifier for each restaurant';

COMMENT ON COLUMN public.location.house_number IS 'The number assigned to the building where the restaurant is located';

COMMENT ON COLUMN public.location.street_name IS 'The lowercased name of the street where the restaurant is located';

COMMENT ON COLUMN public.location.city_name IS 'The lowercased name of the city where the restaurant is located';

CREATE TABLE public.restaurant (
    id bigint,
    name text,
    food_type text,
    city_name text,
    rating real
);

COMMENT ON COLUMN public.restaurant.id IS 'Unique identifier for each restaurant';

COMMENT ON COLUMN public.restaurant.name IS 'The lowercased name of the restaurant';

COMMENT ON COLUMN public.restaurant.food_type IS 'The lowercased type of food served at the restaurant';

COMMENT ON COLUMN public.restaurant.city_name IS 'The lowercased city where the restaurant is located';

COMMENT ON COLUMN public.restaurant.rating IS 'The lowercased rating of the restaurant on a scale of 0 to 5';



